import {
  Home_Hero,
  Half,
  Customers,
  Overall,
  Popular_Courses,
  Instagram,
  Course_Benefits,
  Lordicon,
} from "../comps/Portal";
import {
  homeOverall,
  futureAcademy,
  newWays,
  whatWeAre,
} from "../data/Constants";

const Home = () => {
  return (
    <>
      <Home_Hero />
      <Half thing={futureAcademy} />
      <Popular_Courses />

      <Lordicon iconName="rmkahxvq" />
      <lord-icon
        src="https://cdn.lordicon.com/rmkahxvq.json"
        trigger="hover"
        colors="primary:#e5e7eb"
        style="width:250px;height:250px"
      ></lord-icon>
      <Half thing={newWays} reverse />
      <Course_Benefits />
      <Half thing={whatWeAre} />
      <Instagram />
      <Customers />
      <Overall thing={homeOverall} />
    </>
  );
};

export default Home;
